#define EPS 1e-10

template<typename T>
bool checkArray(int N, T* arr1, T* arr2) {
	for (int i = 0; i < N; ++i) {
		if (arr1[i] != arr2[i])
			return false;
	}
	return true;
}

template<typename T>
bool checkArray(int N, double c1, T* arr1, double c2, T* arr2, double eps) {
	for (int i = 0; i < N; ++i) {
		double mean = std::abs((c1 * arr1[i] + c2 * arr2[i]) / 2);
		if (std::abs(c1 * arr1[i] - c2 * arr2[i]) >(mean * eps))
			return false;
	}
	return true;
}


